Returns a mutable reference to the associated extensions.

# Examples

```
# use http::*;
# use http::header::*;
let mut response: Response<()> = Response::default();
response.extensions_mut().insert("hello");
assert_eq!(response.extensions().get(), Some(&"hello"));
```
